SubCategories subCategoriesFromJson(String str) => SubCategories.fromJson(json.decode(str));
String subCategoriesToJson(SubCategories data) => json.encode(data.toJson());
class SubCategories {
  SubCategories({
      int? id, 
      String? name, 
      List<Product>? product,}){
    _id = id;
    _name = name;
    _product = product;
}

  SubCategories.fromJson(dynamic json) {
    _id = json['Id'];
    _name = json['Name'];
    if (json['Product'] != null) {
      _product = [];
      json['Product'].forEach((v) {
        _product?.add(Product.fromJson(v));
      });
    }
  }
  int? _id;
  String? _name;
  List<Product>? _product;

  int? get id => _id;
  String? get name => _name;
  List<Product>? get product => _product;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['Id'] = _id;
    map['Name'] = _name;
    if (_product != null) {
      map['Product'] = _product?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

